script: |
  super -f text -I q3395.spq | sort > q3395.out

inputs:
  - name: q3395.spq
    data: |
      SELECT DISTINCT col2 - - 79 col2 FROM tab2 (FORMAT parquet) WHERE NULL NOT BETWEEN + + col1 AND + ( - + CAST ( + col1 AS INTEGER ) ) * col2 * - 73;
  - name: tab2

outputs:
  - name: q3395.out
    data: |
